import React from "react";

const SearchForm = () => {
    return (
        <div className="container-fluid">
                                <form className="d-flex">
                                    <input
                                        className="form-control me-2"
                                        type="search"
                                        placeholder="Search"
                                        aria-label="Search"
                                        onChange={handleChangeSearch}
                                        name="search"
                                    />
                                    <button>
                                        <i class="bi bi-search"></i>
                                    </button>
                                </form>
        </div>
    )
}

export default SearchForm;
